<!--suppress JSUnusedGlobalSymbols -->
<template>
  <aside
      :class="collapsed ? 'w-14' : 'w-50'"
      class="h-full transition-all duration-300 flex flex-col pr-1">
    <div class="h-12 flex items-center justify-center shrink-0 pb-1">
      <img
          title="Database Manager"
          src="data:image/png;base64,"
          class="h-8 w-8" alt="Database Manager"/>

      <span
          v-if="!collapsed"
          class="ml-1 font-semibold text-md tracking-wide">
          Database Manager
      </span>
    </div>

    <nav class="flex-1 overflow-y-auto overscroll-contain">
      <button
          v-for="conn in connections"
          :key="conn"
          @click="changeConnection(conn)"
          :title="conn"
          :class="[
          'w-full flex items-center p-2 gap-2 rounded-md cursor-pointer transition mt-1 mb-1',
          collapsed ? 'justify-center' : 'justify-start',
          defaultConnection === conn
            ? 'bg-purple-200 dark:bg-purple-700'
            : 'hover:bg-gray-200 dark:hover:bg-gray-800']">

        <span
            class="flex items-center justify-center w-6 h-6 rounded-full font-bold text-sm bg-gray-400 dark:bg-gray-600">
          {{ conn.charAt(0).toUpperCase() }}
        </span>

        <template v-if="!collapsed">
          <span class="text-sm font-medium ">
            {{ conn }}
          </span>
        </template>
      </button>
    </nav>

    <div class="h-12 shrink-0 flex items-end justify-center pt-1">
      <button
          @click="$emit('toggle')"
          :class="collapsed ? 'justify-center' : 'justify-start'"
          class="w-full flex items-center p-2 gap-1 rounded-md cursor-pointer hover:bg-gray-200 dark:hover:bg-gray-800 transition">
        <template v-if="!collapsed">
          <i class="fa-solid fa-angle-left"></i>

          <span class="text-sm font-medium ">
            Collapse sidebar
          </span>
        </template>

        <template v-else>
          <i class="fa-solid fa-angle-right"></i>
        </template>
      </button>
    </div>
  </aside>
</template>

<script setup>
import {useConnectionStore} from '../stores/ConnectionStore.js';
import {storeToRefs} from 'pinia';
import {useRouter} from 'vue-router';

const props = defineProps({
  collapsed: Boolean,
});

const store = useConnectionStore();
const router = useRouter();

const {connections, defaultConnection} = storeToRefs(store);

function changeConnection(conn) {
  store.setDefault(conn);

  router.push({
    name: 'dashboard',
    params: {connection: conn}
  });
}
</script>
